export function svgToUri(svgName: string, color: string): string {
  const shapeSvg = shapes(color);

  const svg = Str.read(shapeSvg[svgName]) ?? "";
  const url = Base64.encode(svg);

  return `data:image/svg+xml;base64,${url}`;
}
